/*Table structure for table `co_apptokensession` */

DROP TABLE IF EXISTS `co_apptokensession`;

CREATE TABLE `co_apptokensession` (
  `app_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `sys_id` int(11) DEFAULT NULL,
  `token` varchar(50) DEFAULT NULL,
  `lastIp` varchar(50) DEFAULT NULL,
  `lastLng` double(28,14) DEFAULT NULL,
  `lastLat` double(28,14) DEFAULT NULL,
  `lastAddress` varchar(50) DEFAULT NULL,
  `xpp_id` varchar(50) DEFAULT NULL,
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '会话id(主键)',
  `lastAccessTime` datetime DEFAULT NULL,
  `tag` varchar(50) DEFAULT NULL COMMENT '分组标签',
  `online` tinyint(1) DEFAULT NULL,
  `phoneType` varchar(50) DEFAULT NULL COMMENT '手机类型(牌子)',
  `phoneNumber` varchar(50) DEFAULT NULL COMMENT '手机号码',
  `box` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`)
