/*Table structure for table `co_base_action` */

DROP TABLE IF EXISTS `co_base_action`;

CREATE TABLE `co_base_action` (
  `action_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `action_name` varchar(40) NOT NULL COMMENT 'action名称',
  `business_name` varchar(40) NOT NULL COMMENT '该action业务名称(汉字)',
  `business_son_name` varchar(40) NOT NULL COMMENT '更宽泛一些的所属的业务子名称(如微信文本、QQ文本都属于文本)',
  `disable` tinyint(1) DEFAULT '0' COMMENT '是否可用',
  PRIMARY KEY (`action_id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COMMENT='基础action表(action可理解为控制手机发出的一个动作)';

/*Data for the table `co_base_action` */

insert  into `co_base_action`(`action_id`,`action_name`,`business_name`,`business_son_name`,`disable`) values (1,'WeiXinText','微信文本','文本',0),(2,'WeiXinImage','微信图片','图片',0),(3,'WeiXinVoice','微信语音','语音',0),(4,'WeiXinVideo','微信视频','视频',0),(5,'FTPUpload','FTP上传','上传',0),(6,'FTPDownload','FTP下载','下载',0),(7,'TelCaseUI','电话(短)拨号','拨打',0),(8,'TelAnswerCase','电话接听','接听',1),(9,'SMSCaseUI','短信','接收',1),(10,'WebBrowser','Web网页','浏览',0),(11,'Ping','Ping','Ping',0),(12,'TencentVideo','Video——app','VideoPlay',1),(13,'AirPlaneMode','飞行模式控制','FlyMode',1),(14,'LBSHedituSearch','LBS和地图查询','搜索',1),(15,'LBSHedituPath','LBS和地图','查询',1),(16,'Live','视频直播','直播',0),(17,'PlayMusic','播放音乐','音乐',0),(18,'TelCaseUIL','电话(长)拨号','拨打',0);

/*Table structure for table `co_base_param` */

DROP TABLE IF EXISTS `co_base_param`;

CREATE TABLE `co_base_param` (
  `param_id` varchar(40) NOT NULL DEFAULT '' COMMENT '参数项所属类型id(比如参数''微信文本''与''微信语音''都属于''微信''类型)',
  `param_name` varchar(40) NOT NULL DEFAULT '' COMMENT '参数名(汉字)',
  `param_all_name` varchar(40) NOT NULL DEFAULT '' COMMENT '参数项key(唯一的，相当于主键，代表一个唯一的参数项)',
