  `param_type` int(11) DEFAULT '0' COMMENT '参数类别(数字表示)',
  `param_verify` varchar(255) DEFAULT NULL COMMENT '参数值合法校验格式',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8 COMMENT='基础参数表';

